import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default function Investments() {
    return (
        <>
            <Container>
                <Row>
                    <Col>
                        <p>You can see your investments after login.</p>
                    </Col>
                </Row>
            </Container>
        </>
    );
}
